import React from 'react';
import { useNavigate } from 'react-router-dom';

function PrivateRoute({ children }) {
    const token = localStorage.getItem('user-token');

    if (!token) {
        const navigate = useNavigate();
        navigate('/testsite');
    }
    return children;
}

export default PrivateRoute;
